const list = [
    {
        id : 1,
        productId : 1,
        userUniqueId : '지금은',
        title : "살려줘",
        content : "내용",
        viewCount : 32

    },

    {
        id : 2,
        productId : 1,
        userUniqueId : '새벽',
        title : "대체 왜",
        content : "내용",
        viewCount : 65

    },
    
    {
        id : 3,
        productId : 1,
        userUniqueId : '4시',
        title : "밑줄이",
        content : "내용",
        viewCount : 15
        
    },

    {
        id : 4,
        productId : 1,
        userUniqueId : '갬-성이',
        title : "여기서",
        content : "내용",
        viewCount : 98
        
    },

    {
        id : 5,
        productId : 1,
        userUniqueId : '터지는시간',
        title : "안없어지는거야아아아아아아아아아아아아아아아아아아아아아아아아아",
        content : "내용",
        viewCount : 1872
        
    }
];

const ComplexList = () => ( 
    <ul> 
        {list.map(item => ( 
        <li key={item.id}> 
            <div>{item.id}</div> 
            <div>{item.firstname}</div> 
            <div>{item.lastname}</div> 
            <div>{item.year}</div> 
        </li> ))} 
    </ul> 
); 


export default ComplexList;
